import { useEffect, useState } from 'react';
import './static/Post.css'
import axios from 'axios';
const Post = () =>{
    const [Categories,SetCategories] = useState([])
    const categories = [
        { _id: '1', category: 'Technology', __v: 0 },
        { _id: '2', category: 'Science', __v: 0 },
        { _id: '3', category: 'Arts', __v: 0 },
      ];
    async function fetchcateg(){
        const response = await axios.get("http://localhost:5000/category/view_category");
        SetCategories(response.data);
        }
    useEffect(()=>{
        fetchcateg();
    },[]);
    
    return(
        <>
        <div className="form">
            {categories}
        <form>
            <div class="mb-3 mt-3">
               <label for="title" className="form-label">Title:</label>
                <input type="text" name="title" placeholder="Project Title" className="form-control"/>
                </div>
                <div class="mb-3 mt-3">
                {categories.map((c)=>(
                    <div key={c._id}>{c.category}</div>
                ))}
                </div>
                <div class="mb-3 mt-3">
               <label for="title" className="form-label">Title:</label>
                <input type="text" name="title" placeholder="Project Title" className="form-control"/>
                </div>
                <div class="mb-3 mt-3">
               <label for="title" className="form-label">Title:</label>
                <input type="text" name="title" placeholder="Project Title" className="form-control"/>
                </div>
                <div class="mb-3 mt-3">
               <label for="title" className="form-label">Title:</label>
                <input type="text" name="title" placeholder="Project Title" className="form-control"/>
                </div>
                <div class="mb-3 mt-3">
               <label for="title" className="form-label">Title:</label>
                <input type="text" name="title" placeholder="Project Title" className="form-control"/>
                </div>
                </form>
        </div>
        </>
    )
}
export default Post;
